import React from 'react';
import './Home.css';
import profile from "../../assets/images/profile.webp";

const Home = () => {
  return (
    <main className="home-container">
      <h1 className="intro-text">I'm a freelancer who enjoys working on projects</h1>
      <h2 className="fullstack">Fullstack</h2>
      <h3 className="webdeveloper">Webdeveloper</h3>
      <div className="image-container">
        <img src={profile} alt="Fullstack Web Developer" className="developer-image" />
      </div>
      <div className="button-container">
        <a href="/resume.pdf" download className="download-btn">Download Resume</a>
        <a href="/contact" className="hire-btn">Hire Me</a>
      </div>
    </main>
  );
};

export default Home;
